    function Create() {
        var name = $(""#Name"").val();
        var address = $(""#Address"").val();
        var email = $(""#Email"").val();
        var phone = $(""#Phone"").val();
        var state = $(""#State"").val();
        var city = $(""#City"").val();
        var pincode = $(""#Pincode"").val();

